import * as actionTypes from "./actions/actionTypes";

const initialState = {
  id: "65e2d3e4-b53e-4e26-a276-1ef77fef4c96",
  name: "Ana",
  surname: "Pereira",
  email: "rita@teste.pt",
  phone: "917141258",
  address: "Rua da Independencia, Rio Tinto, 4435-039",
  username: "admin",
  password: "$2a$10$OirxTnFRKwTPX3V2DDqInuvSRNzeSk0mLpkmjAWUgMhBweXSlcsbu",
  roles: [],
  enabled: true,
  accountNonExpired: true,
  credentialsNonExpired: true,
  accountNonLocked: true,
  img: ""
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case actionTypes.ADD_PRODUCT:
      return {};
    default:
      return state;
  }
};

export default reducer;
